import React from "react";

import Navigation from "../components/Navigation";

const Accueil = () => {
  return (
    <div>
      <Navigation />
      <h1>Accueil</h1>
      <Section>
        <div>
          <h2>blabla</h2>
        </div>
      </Section>
    </div>
  );
};

export default Accueil;
